INSERT INTO `playerchoice_response` VALUES (51, 120, 1, 986496, '', 'Arcane Sanctum', 'The Arcane Sanctum will transform some of your forces into powerful spellcasters.\n\nOnce fully operational, it grants the use of |cFFFF0000|Hspell:161767|h[Guardian Orb]|h|r within Talador.', '', 0);
INSERT INTO `playerchoice_response` VALUES (52, 121, 0, 986495, '', 'Armory Vol\'jina', 'The Vol\'jin Armory provides high-quality weapons and armor for your soldiers.\r\n\r\nAs soon as the armory is completed, you will have the ability | cFFFF0000 | Hspell: 162075 | h [Artillery strike] | h | r within Talador.', '', 0);
INSERT INTO `playerchoice_response` VALUES (52, 122, 1, 986497, '', 'Magic sanctuary', 'The magic sanctuary will turn part of your troops into powerful spellcasters.\r\n\r\nAs soon as the sanctuary is completed, you will have the ability | cFFFF0000 | Hspell: 161767 | h [Security sphere] | h | r within Talador.', '', 0);
INSERT INTO `playerchoice_response` VALUES (53, 123, 0, 1011903, '', 'Stall rangari', 'Rangari stalls will provide improved riding tanks for your soldiers.\r\n\r\nAs soon as the stalls are completed, you will have the ability | cFFFF0000 | Hspell: 165803 | h [Telaar Talbuk] | h | r within Nagrand.', '', 0);
INSERT INTO `playerchoice_response` VALUES (53, 124, 1, 1011905, '', 'Tank workshop of Telaar', 'The Telaar Tank Shop will provide siege vehicles for your soldiers.\r\n\r\nAs soon as the workshop is completed, you will have the ability | cFFFF0000 | Hspell: 160240 | h [Telaar tank] | h | r within Nagrand.', '', 0);
INSERT INTO `playerchoice_response` VALUES (54, 125, 0, 1011904, '', 'Vorvarskie stall', 'Vor\'var stalls will provide improved mountable Frostwolves for your soldiers.\r\n\r\nAs soon as the stalls are completed, you will have the ability | cFFFF0000 | Hspell: 164222 | h [Northern War Wolf] | h | r within Nagrand.', '', 0);
INSERT INTO `playerchoice_response` VALUES (54, 126, 1, 1011906, '', 'Tank workshop of Vor\'var', 'The Vor\'war tank workshop will provide destroyers for your soldiers.\r\n\r\nAs soon as the workshop is completed, you will have the ability | cFFFF0000 | Hspell: 160241 | h [Vor\'var destroyer] | h | r within Nagrand.', '', 0);
INSERT INTO `playerchoice_response` VALUES (55, 127, 0, 1041262, '', 'Highpass Logging Camp', 'The Highpass Logging Camp will allow for operations in the jungle overgrowth of southern Gorgrond.\n\nOnce fully operational, the Highpass Logging Camp grants the use of |cFFFF0000|Hspell:164050|h[Summon Mechashredder 5000]|h|r within Gorgrond.', '', 0);
INSERT INTO `playerchoice_response` VALUES (55, 128, 1, 1041768, '', 'Highpass Sparring Ring', 'The Highpass Sparring Ring will allow for operations in the brutal wastelands of northern Gorgrond.\n\nOnce fully operational, the  Highpass Sparring Ring grants the use of |cFFFF0000|Hspell:164012|h[Champion\'s Honor]|h|r within Gorgrond.', '', 0);
INSERT INTO `playerchoice_response` VALUES (56, 129, 0, 1041263, '', 'Lowland sawmill', 'The lowland sawmill provides resources daily and reduces the cost of other garrison buildings and specializations.\r\n\r\nAs soon as the sawmill is completed, you will see the ability | cFFFF0000 | Hspell: 164050 | h [Call mechanical shredder-5000] | h | r within Gorgronda.', '', 0);
INSERT INTO `playerchoice_response` VALUES (56, 130, 1, 1041769, '', 'Savage Fight Club', 'The Savage Fight Club will provide training tasks to improve teammates.\r\n\r\nAs soon as the fight club is completed, you will have the ability | cFFFF0000 | Hspell: 164012 | h [Hero\'s Honor] | h | r within Gorgrond.', '', 0);
INSERT INTO `playerchoice_response` VALUES (57, 131, 0, 1041765, '', 'Tavern \"Home\"', 'The Home Hearth Tavern will accommodate more soldiers and raise the morale of your troops.\r\n\r\nAs soon as the tavern is completed, you will have the ability | cFFFF0000 | Hspell: 168499 | h [Home away from home] | h | r within the Peaks of Arak.', '', 0);
INSERT INTO `playerchoice_response` VALUES (57, 132, 1, 1041767, '', 'Smugglers\' Lair', 'The lair of smugglers will allow to establish ways of communication with other troops and gain access to rare resources and supplies.\r\n\r\nAs soon as the lair is completed, you will see the ability | cFFFF0000 | Hspell: 170097 | h [Smuggled path!] | H | r within the Peaks of Arak.', '', 0);
INSERT INTO `playerchoice_response` VALUES (58, 133, 0, 1041764, '', 'Stoktron Brewery', 'The Stoktron Brewery will provide housing for additional troops and boosts the morale of your forces.\n\nOnce fully operational, the Stoktron Brewery grants the use of |cFFFF0000|Hspell:168487|h[Home Away from Home]|h|r within Spires of Arak.', '', 0);
INSERT INTO `playerchoice_response` VALUES (58, 134, 1, 1041766, '', 'Smuggler\'s Den', 'The Smuggler\'s Den will open up trade routes with other forces, granting access to rare supplies and materials.\n\nOnce fully operational, the Smuggler\'s Den grants the use of |cFFFF0000|Hspell:170108|h[Smuggling Run!]|h|r within Spires of Arak.', '', 0);
INSERT INTO `playerchoice_response` VALUES (63, 143, 0, 1042053, '', 'Lands of Stone Fury', 'The Bloodmaul ogres from Frostfire Ridge ambush trade routes across the continent and force captured soldiers to work in their slag mines.\r\n\r\nThe Dark Hunter Rokhan asks for the release of the captured allies held in the main Bloodmaul camp in the Lands of Stone Fury.', '', 0);
INSERT INTO `playerchoice_response` VALUES (63, 144, 1, 1041981, '', 'Shattrath', 'Shattrath is under the control of Sargerai troops led by exarch traitor Socrethar.\r\n\r\nThanks to the help of the Nether demons, the forces of the Shadow Council are strengthening their position in the eastern part of the city. They must be dealt with before they become a threat to us.', '', 0);
INSERT INTO `playerchoice_response` VALUES (65, 147, 0, 1042055, '', 'Magnarok', 'Colossal magnaron, gronn, and other stone monstrosities have been threatening our outposts in the west. Most seem to originate from Magnarok in Frostfire Ridge.\n\nIf we strike at them at their home, we should be able to force them back. It\'s risky, but it may be our best move. While you\'re there, see if you can recover any of our supplies.', '', 0);
INSERT INTO `playerchoice_response` VALUES (65, 148, 1, 1042005, '', 'The Pit (Group)', 'The Blackrock forces based out of the Pit in Gorgrond make up the bulk of the Iron Horde army. If we crush them on their home soil, the rest of the Iron Horde will have little hope of standing against us.\n\nIf you choose the battle, bring friends. The Blackrock won\'t be defeated easily.', '', 0);
INSERT INTO `playerchoice_response` VALUES (70, 157, 0, 1042067, '', 'Plateau of the Secretary', 'Recent reports indicate increased activity of the Sargerai troops on the Socretar Plateau in the Shadowmoon Valley.\r\n\r\nSocrethar\'s minions present a danger to both the draenei and our garrison. You need to deal with them as soon as possible.', '', 25961);
INSERT INTO `playerchoice_response` VALUES (70, 158, 0, 1042005, '', 'Pit (group)', 'The forces of the Blackrock clan, based in the Pit area of Gorgrond, form the backbone of the Iron Horde army. If we smash them in their native land, the remnants of the Iron Horde will no longer be able to withstand us.\r\n\r\nIf you decide on this battle, take reliable comrades with you. Its definitely not worth counting on an easy victory over the Black Mountain clan.', '', 25961);
INSERT INTO `playerchoice_response` VALUES (72, 161, 0, 1041783, '', 'Upper Skettis', 'We regularly receive disturbing reports from the south - bird people ambush caravans on major trade routes and burn them.\r\n\r\nThe guards at our outposts are asking to take action and counterattack the main forces of the adherents of Rukhmar in Skettis on the Peaks of Arak.', '', 0);
INSERT INTO `playerchoice_response` VALUES (72, 162, 1, 1042005, '', 'Pit (group)', 'The forces of the Blackrock clan, based in the Pit area of Gorgrond, form the backbone of the Iron Horde army. If we smash them in their native land, the remnants of the Iron Horde will no longer be able to withstand us.\r\n\r\nIf you decide on this battle, take reliable comrades with you. Its definitely not worth counting on an easy victory over the Black Mountain clan.', '', 0);
INSERT INTO `playerchoice_response` VALUES (86, 189, 0, 1041782, '', 'Shadowmoon Enclave', 'Remains of the Shadowmoon clan continue their subversive activities in the mountains on the eastern border of Arak Peaks.\r\n\r\nBoudrick Gray is concerned that the enemy has come too close to the garrison, and instructed to deal with this problem as soon as possible.', '', 0);
INSERT INTO `playerchoice_response` VALUES (86, 190, 1, 1041980, '', 'Shattrath (group)', 'Every day, the Sargerai troops in Shattrath are becoming stronger and bolder. They pose a serious threat and can no longer be ignored.\r\n\r\nGather allies if you want to launch an attack on the Sargerais who took refuge in the city.', '', 0);
INSERT INTO `playerchoice_response` VALUES (87, 191, 0, 1042067, '', 'Plateau of the Secretary', 'Recent reports indicate increased activity of the Sargerai troops on the Socretar Plateau in the Shadowmoon Valley.\r\n\r\nSocrethar\'s minions present a danger to both the draenei and our garrison. You need to deal with them as soon as possible.', '', 26365);
INSERT INTO `playerchoice_response` VALUES (87, 192, 0, 1041980, '', 'Shattrath (group)', 'Every day, the Sargerai troops in Shattrath are becoming stronger and bolder. They pose a serious threat and can no longer be ignored.\r\n\r\nGather allies if you want to launch an attack on the Sargerais who took refuge in the city.', '', 26365);
INSERT INTO `playerchoice_response` VALUES (91, 199, 0, 1042066, '', 'Darktide Nesting Ground', 'During our battles with the Iron Horde, more and more rilaks begin to appear on the battlefield. If you do not deal with them, then we will lose control of all roads and will be forced to retreat to outposts.\r\n\r\nMost likely, these rilaks are sent from the Darktide Nest in the Shadowmoon Valley. If we act quickly, we can solve this problem.', '', 0);
INSERT INTO `playerchoice_response` VALUES (91, 200, 1, 1041980, '', 'Shattrath (group)', 'Every day, the Sargerai troops in Shattrath are becoming stronger and bolder. They pose a serious threat and can no longer be ignored.\r\n\r\nGather allies if you want to launch an attack on the Sargerais who took refuge in the city.', '', 0);
INSERT INTO `playerchoice_response` VALUES (95, 207, 0, 1042006, '', 'Thickets of Eternal Blossom', 'Botany and the monster plants they created are slowly getting to our outposts in the north. In place of each dead creature, several new ones immediately appear.\r\n\r\nBoudrick Gray believes that we must deliver a counterattack to the very heart of their possessions and attack the Eternal Flowering Thickets. He hopes that this way we can throw them back into the wilderness of Gorgrond, and then we will have room for maneuver.', '', 0);
INSERT INTO `playerchoice_response` VALUES (95, 208, 1, 1041981, '', 'Shattrath', 'Shattrath is under the control of Sargerai troops led by exarch traitor Socrethar.\r\n\r\nSha\'tar defenders are asking for help in fighting the Shadow Council forces in the eastern part of the city.', '', 0);
INSERT INTO `playerchoice_response` VALUES (99, 215, 0, 1042067, '', 'Plateau of the Secretary', 'Recent reports indicate increased activity of the Sargerai troops on the Socretar Plateau in the Shadowmoon Valley.\r\n\r\nSocrethar\'s minions present a danger to both the draenei and our garrison. You need to deal with them as soon as possible.', '', 0);
INSERT INTO `playerchoice_response` VALUES (99, 216, 1, 1041981, '', 'Shattrath', 'Shattrath is under the control of Sargerai troops led by exarch traitor Socrethar.\r\n\r\nSha\'tar defenders are asking for help in fighting the Shadow Council forces in the eastern part of the city.', '', 0);
INSERT INTO `playerchoice_response` VALUES (109, 235, 0, 1042055, '', 'Magnarok', 'Huge magnarons, gronns and other stone monsters - all of them threaten our western borders. Most of them seem to be from Magnarok, on the Frostfire Range.\r\n\r\nBy hitting them in their own lair, we will force them to retreat from our lands. This is risky, but we have no better plan. And while you\'re there, look for our supplies.', '', 0);
INSERT INTO `playerchoice_response` VALUES (109, 236, 1, 1042054, '', 'Iron Horde Camp', 'Iron Horde fighting vehicles enter the battlefield in dozens, and it is extremely difficult for us to resist them. Apparently, these combat vehicles are being taken from the siege camp of the Iron Horde, which is located in the eastern part of the Icefire Range.\r\n\r\nIf we knock out the Iron Horde from the siege camp and stop the supply of military vehicles, we will turn the tide of the war.', '', 0);
INSERT INTO `playerchoice_response` VALUES (116, 249, 0, 1041782, '', 'Shadowmoon Enclave', 'Remains of the Shadowmoon clan continue their subversive activities in the mountains on the eastern border of Arak Peaks.\r\n\r\nBoudrick Gray is concerned that the enemy has come too close to the garrison, and instructed to deal with this problem as soon as possible.', '', 0);
INSERT INTO `playerchoice_response` VALUES (116, 250, 1, 1042076, '', 'Ashran (PvP)', 'While we are fighting in Draenor, the vile Horde is trying to recapture the lands of Ashran from us.\r\n\r\nThe fighting spirit of our troops will rise if you take part in the battle and strike terror into the hearts of enemies.', '', 0);
